import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Rose',
          id: ''
        },
        {
          name: 'Rosie'
        },
        {
          name: 'Rose'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return <h1 key={monster.name}>{monster.name}</h1>;
          })
        }
      </div>
    );
  }
}

export default App;
